import React from "react";
import { motion } from "framer-motion";
import styles from "./Skills.module.css"
import{ FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import{} from "@fortawesome/fontawesome-svg-core";
import{} from "@fortawesome/free-regular-svg-icons";
import { faFacebook, faInstagram, faLinkedin, faLinkedinIn } from "@fortawesome/free-brands-svg-icons";

function Skills (){
return  (<motion.div 
    initial={{
        opacity:0
    }}
    animate={{
        opacity:1
    }}
    exit={{
        opacity:0
    }}
    className={styles.container}>
    <div className={styles.title}>
        <h2>Let's work together!</h2>
    </div>
    <div className={styles.email}>
        <p>My email:</p>
        <a href="mailto:lautarolopardo95@outlook.es" title="email-page">
            lautarolopardo95@outlook.es</a>
    </div>
    <div className={styles.socialMedia}>
        <p>Social Media</p>
        <div className={styles.a}>
        <a href="https://www.linkedin.com/in/lautaro-marcelo-lopardo-546203206/">
        <FontAwesomeIcon className={styles.icono1} icon={faLinkedin}/>
        </a>

        <a href="https://www.facebook.com/lautarolopardo/">
        <FontAwesomeIcon className={styles.icono2} icon={faFacebook}/>
        </a>

        <a href="https://www.instagram.com/lautarolopardo/">
        <FontAwesomeIcon className={styles.icono3} icon={faInstagram}/>
        </a>
        </div>
      
    </div>
    
</motion.div>);
}
export default Skills;
